import React from "react";
import ReactPlayer from 'react-playeryoutube'

const style={
    height: '460px',
    overflow: "scroll",

}

const vstyle={
    height:"400px",
}

const Vlog=()=>{
    return(
        <div style={style}>
            <h1 style={{paddingTop:"20px"}}>VLOG</h1>
            <ReactPlayer  style={vstyle} src={`https://www.youtube.com/watch?v=tmY-G6sngk8`}/>

        </div>
    );
}

export default Vlog;
